import AllQuotes from './pages/AllQuotes';
import AddQuote from './pages/AddQuote';
import FullScreen from "./pages/FullScreen";
import Navbar from './components/UI/Navbar';

function App() {
  return (

    <Switch>

    <Route path="/" exact>
      <Redirect to="/allQuotes"/>
    </Route>

    <Route path="/allQuotes">
    <AllQuotes/>
    </Route>

    <Route path="/quote/:id">
   <p>quote id</p>
    </Route>

    <Route path="/addQuote">
<AddQuote/>
    </Route>
  </Switch>

  );
}

export default App;
